INSERT INTO `explorer_query` VALUES (1,'Elektronski naslovi članov','SELECT ime,\r\n       priimek,\r\n       naslov,\r\n       mail_naslov\r\nFROM ROG2021_CLAN\r\nWHERE MAIL_NASLOV IS NOT NULL\r\n  AND ind <> 9 ;','Elektronski naslovi članov','2021-11-17 14:35:11.327218','2021-12-21 20:46:57.611684',1,0,'default'),(6,'Neplacniki_2021','SELECT  rog2021_clan.ime,\r\n		rog2021_clan.priimek,\r\n        rog2021_clan.naslov,\r\n        rog2021_placila.leto,\r\n        rog2021_placila.vrsta_placila,\r\n        rog2021_placila.znesek\r\nFROM    rog2021_clan INNER JOIN\r\n                 rog2021_placila ON rog2021_clan.id_clan = rog2021_placila.id_clan_fk_id\r\nWHERE  (rog2021_clan.ind <> 9) AND (rog2021_placila.znesek = 0) AND (rog2021_placila.leto = 2021)','neplačniki za leto 2021','2021-12-21 10:02:33.518314','2021-12-21 12:08:52.054994',1,0,'default'),(7,'Placniki_2021','SELECT rog2021_clan.ime,\r\n       rog2021_clan.priimek,\r\n       rog2021_clan.naslov,\r\n       rog2021_placila.leto,\r\n       rog2021_placila.vrsta_placila,\r\n       rog2021_placila.znesek\r\nFROM rog2021_clan\r\nINNER JOIN rog2021_placila ON rog2021_clan.id_clan = rog2021_placila.id_clan_fk_id\r\nWHERE (rog2021_clan.ind <> 9)\r\n  AND (rog2021_placila.znesek > 0)\r\n  AND (rog2021_placila.leto = 2021)','Plačana članarina za leto 2021','2021-12-21 12:11:43.890251','2021-12-21 12:11:43.904264',1,0,'default'),(8,'Nadpovprečni plačniki','SELECT c.ime,\r\n       c.priimek,\r\n       CONCAT(CAST(ROUND(AVG(p.znesek), 2) AS NCHAR), _ucs2 0x20AC)  AS \"Povprečje na leto\"\r\nFROM lol2.rog2021_clan c\r\nINNER JOIN lol2.rog2021_placila p ON (p.id_clan_fk_id = c.id_clan)\r\nWHERE c.ind != 9\r\nGROUP BY c.ime,\r\n         c.priimek\r\nHAVING AVG(p.znesek) >\r\n  (SELECT AVG(znesek)\r\n   FROM lol2.rog2021_placila pl\r\n   INNER JOIN lol2.rog2021_clan cl ON (pl.id_clan_fk_id = cl.id_clan)\r\n   WHERE cl.ind != 9 );','Nadpovprečni plačniki','2021-12-21 20:32:45.971459','2021-12-21 20:48:14.632842',1,0,'default');
